import Link from 'next/link';

const LandingPage = () => (
    <div>
        <Link href="/dealer">
            <a>Dealer</a>
        </Link>
        <Link href="/customer">
            <a>Customer</a>
        </Link>
        <p>Landing Page</p>
    </div>
);

export default LandingPage;
